import React, { useLayoutEffect } from 'react';
import { connect } from 'react-redux';
import { Link, Route } from 'react-router-dom';
import { compose } from 'redux';
import { getDataState } from '../redux/data-reducer';

const GameEnd = (props) => {
    useLayoutEffect(() => {
        props.getDataState();
    }, []);
    const finalScore = (level) => {
        console.log(level);
        switch(level) {
            case 1: return 0;
            case 2: return 1000;
            case 3: return 2000;
            case 4: return 4000;
            case 5: return 8000;
            case 6: return 16000;
            case 7: return 32000;
            case 8: return 64000;
            case 9: return 125000;
            case 10: return 250000;
            case 11: return 500000;
            case 12: return 1000000;
            default: return 0;
        }
        props.setLevel(1);
    }
    return (
        <div>
            {/* <GameLogo /> */}
            <div>Total score: {finalScore(props.level)}</div>
            {/* <MainText /> */}
            <Link to='/game'>
                <button>Try Again</button>
            </Link>
            <Route path='gameEnd'></Route>
        </div>
    )
}

const mapStateToProps = (state) => ({
    level: state.game.currentLevel
})

export default compose(connect(mapStateToProps, { getDataState }))(GameEnd);
